            title : 'Badge of Honor from <weavy/> Collaboration Hackathon',
            details : 'Won :Badge of honor Award at <weavy/> Collaboration Hackathon, 2020.',
            date : 'November, 2020',
            field : '<weavy />',
            image : 'https://media.glassdoor.com/sqll/1878094/weavy-squarelogo-1511114243224.png'
        },
        {
            id : 4,
            title : 'District Level Best NSS Volunteer',
            details : 'Won the District Level Best Volunteer Award of National Service Scheme for Kottayam District,Kerala,India',
            date : 'December 2017',
            field : 'Government of Kerala',
            image : 'https://www.hrkatha.com/wp-content/uploads/2021/05/Kerala-Government.png'
        },

    ]
}


